import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className='navbar'>
      <h1>Story Wall</h1>
      <div className='links'>
        <Link to='/'>Home</Link>
        <Link
          to='/create'
          style={{
            color: "white",
            backgroundColor: "#FD1C03 ",
            borderRadius: "8px",
            boxShadow: ""
          }}
        >
          New Blog
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
